import { useState } from "react";

export const [home, setHome] = useState(true);
export const [currentPage, setCurrentPage] = useState("home");
export const [space, setSpace] = useState(false);
export const [earth, setEarth] = useState(false);

export const pageStates = {
  Space: {
    state: space,
    setState: setSpace,
    class: "space",
    title: "Space",
  },
  "Our Planet": {
    state: earth,
    setState: setEarth,
    class: "earth",
    title: "Our Planet",
  },
};
